    return (
        <div class="prodPage">
            <div className="breadcrumbs">
                <Breadcrumb>
                        <Breadcrumb.Item>
                        
                        </Breadcrumb.Item>
                </Breadcrumb>
            </div>
        </div>
    );
}
export default Product;
